package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  hamster_data =""
)
var hamster = &glui.ImageData{nil, 900, 552}
func load_hamster() bool {
  b, err := base64.StdEncoding.DecodeString(hamster_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  hamster.Pix = c.Bytes()
  return true
}
var hamster_loaded = load_hamster()